jordbær: helmelk, skummetmelkpulver

ingredients:
Banan: helmelk, 5 % bananpuré*, 5 % bananjuice*, skummetmelkpulver, druejuice*, 2 % sukker, naturlig aroma, gulrotkonsentrat, tistel - og sitronkonsentrat, maisstivelse, yoghurtkultur. * fra konsentrat;
mango: helmelk, 7 % mangopuré*, skummetmelkpulver, 4 % sukker, maisstivelse, naturlig aroma, gulrotjuicekonsentrat, tistel- og sitronkonsentrat, yoghurtkultur. * fra konsentrat;
vanilje: helmelk, 4 % sukker, skummetmelkpulver, maisstivelse, vaniljeekstrakt, sitron- og tistelkonsentrat, naturlig aroma, yoghurtkultur.;
jordbær: helmelk, 6 % jordbærpuré*, skummetmelkpulver, 4 % sukker, maisstivelse, naturlig aroma, svart gulrotkonsentrat, yoghurtkultur. *fra konsentrat

Jordbær: skummet melk, 11 % jordbær, skummetmelkpulver, polydekstrose (fiber), gelatin, naturlig aroma, hyllebærjuice*, søtstoffer (acesulfam k, sukralose), yoghurtkultur 
* fra konsentrat;
bringebær: skummet melk, 10 % bringebær, skummetmelkpulver, polydekstrose (fiber), gelatin, hyllebær*, naturlig aroma, søtstoffer (acesulfam k, sukralose), yoghurtkultur * fra konsentrat
